import { AppBar, Toolbar, styled } from "@mui/material"; //AppBar and ToolBar is used for header while styled is used to give css to Components
//components
import LoginDialog from "../accounts/LoginDialoge";

const Header = styled(AppBar)`
  height: 200px;
  background-color: #00bfa5;
`;

const Messenger = () => {
  return (
    <>
      <Header>
        <Toolbar></Toolbar>
      </Header>
      <LoginDialog />
    </>
  );
};

export default Messenger;
